import { useState } from 'react'

const IndexPage = () => {

    const oneCall = () => {

        const [input, setInput] = useState([])

        apiService
            .getInput()
            .then(({ data }) => console.log(data))
            .catch(err => console.log(err))
    }

    return (
        <>
            <h1>Indexpage funcional</h1>
        </>
    )

}
export default IndexPage
